import React from "react";
import "./MealsSummary.css";
const MealsSummary = () => {
  return (
    <>
      <section className="summary">
        <h2>Delicious Food Served To You</h2>
        <p>
          Choose Your Favourite Food From Avalilable Meals And Enjoy a Delicious
          Food
        </p>
        <p>
          All Our Food Are Cooked With High Quality Ingredients, Just In Time
          And Of Course By Best Chefs
        </p>
      </section>
    </>
  );
};

export default MealsSummary;
